import React from 'react';
import { CartItem } from '../cart';

export default function ListCardItem({citems}) {
    return (
        <div>
            <div class="category">
                <div class="category__item-use"><span>Привелегии</span></div>
                <div class="category__item"><span>Кейсы</span></div>
                <div class="category__item"><span>Вещи</span></div>
                <div class="category__item"><span>Валюта</span></div>
            </div>

            <div class="cards">
                {citems.map(citem => <CartItem citem={citem} /> )}
            </div>
        </div>
    )
};
